  render(): React.ReactElement<any> {
    const {menuStore: {currentMenu}} = this.props
    return (
       <div className="App">
            <header className="App-header">
                Learn React
                <p>这是渲染的mobx: {currentMenu}</p>
                <p><LikeButton/></p>

            </header>
    </div>
    )
  }
}

